INSERT INTO Trips (Name, Price, Days, Description, Number_of_Sites, programName) VALUES ('Cairo Splendor', '550', '3', 'Day 1: Visit Baron Palace, Manial Palace. Day 2: Explore Prince Mohammed Ali Palace (Al-Manial Palace Museum), Cairo Airport Museum 2. Day 3: Tour Cairo Airport Museum 3.', '5', 'Major Cities Program');
INSERT INTO Trips (Name, Price, Days, Description, Number_of_Sites, programName) VALUES ('Urban Heritage', '600', '3', 'Day 1: Visit Royal Carriages Museum, Farouk Corner Museum. Day 2: Explore The Egyptian Museum (Tahrir Square), Audio Guide (for Groups) - The Egyptian Museum. Day 3: Tour Al-Ghouri Wekala, Al-Mawlawi Tekkiyeh.', '6', 'Major Cities Program');
INSERT INTO Trips (Name, Price, Days, Description, Number_of_Sites, programName) VALUES ('Delta Discovery', '650', '4', 'Day 1: Visit Suez National Museum, Ismailia Museum. Day 2: Explore Kafr El-Sheikh Museum, Tanta Museum. Day 3: Tour Tell Basta Museum, Kom Oshim Museum. Day 4: Visit Matrouh Museum.', '7', 'Major Cities Program');
INSERT INTO Trips (Name, Price, Days, Description, Number_of_Sites, programName) VALUES ('Cultural Capitals', '700', '4', 'Day 1: Visit National Museum of Egyptian Civilization, Gamal El-Din Al-Dhahabi House. Day 2: Explore Ali Labib House, Qaytbay Sabil-Kuttab (Salah Al-Din Street). Day 3: Tour Prince Taz Palace, Al-Sitt Wasila House. Day 4: Visit Nafisa Al-Bayda Sabil-Kuttab, Royal Family Tombs.', '8', 'Major Cities Program');
INSERT INTO Trips (Name, Price, Days, Description, Number_of_Sites, programName) VALUES ('Alexandria Quest', '700', '4', 'Day 1: Visit Kom El-Dikka (Roman Theatre), Sunken Monuments of the Eastern Harbor. Day 2: Explore Anfushi Tombs, Mostafa Kamel Tombs. Day 3: Tour Al-Shatby Necropolis, Cave of Rommel Museum. Day 4: Visit Tree of the Virgin Mary, Al-Zahir Baybars Mosque.', '8', 'Major Cities Program');
INSERT INTO Trips (Name, Price, Days, Description, Number_of_Sites, programName) VALUES ('Regional Riches', '800', '5', 'Day 1: Visit Mallawi Museum, New Valley Museum. Day 2: Explore Sohag National Museum, Prince Youssef Kamal Palace. Day 3: Tour Audio Guide - Luxor Museum, Al-Darb Al-Ahmar Tourist Path. Day 4: Visit Al-Hawawish Tombs, Deir El-Hagar Temple. Day 5: Explore Pashedu Tomb, Ay Tomb.', '10', 'Major Cities Program');
INSERT INTO Trips (Name, Price, Days, Description, Number_of_Sites, programName) VALUES ('Pyramid Pathways', '600', '3', 'Day 1: Visit Giza Pyramids, Sphinx. Day 2: Explore Saqqara Necropolis, Step Pyramid of Djoser (Southern Entrance). Day 3: Tour Dahshur Archaeological Area.', '5', 'Historical Program');
INSERT INTO Trips (Name, Price, Days, Description, Number_of_Sites, programName) VALUES ('Cairo Chronicles', '650', '3', 'Day 1: Visit Egyptian Museum, Museum of Islamic Art. Day 2: Explore The Coptic Museum, National Museum of Egyptian Civilization. Day 3: Tour Salah El-Din Citadel, Gayer-Anderson Museum.', '6', 'Historical Program');
INSERT INTO Trips (Name, Price, Days, Description, Number_of_Sites, programName) VALUES ('Luxor Legends', '700', '4', 'Day 1: Visit Luxor Temple, Karnak Temple. Day 2: Explore Valley of the Kings, Seti I Tomb. Day 3: Tour Temple of Hatshepsut, Colossi of Memnon. Day 4: Visit Ramesseum Temple.', '7', 'Historical Program');
INSERT INTO Trips (Name, Price, Days, Description, Number_of_Sites, programName) VALUES ('Aswan Horizons', '800', '4', 'Day 1: Visit Philae Temple, Unfinished Obelisk. Day 2: Explore Abu Simbel Temples. Day 3: Tour Nubian Museum, Kalabsha Temples. Day 4: Visit Elephantine Island, Qubbet El-Hawa, Nileometer.', '8', 'Historical Program');
INSERT INTO Trips (Name, Price, Days, Description, Number_of_Sites, programName) VALUES ('Coastal Chronicles', '800', '4', 'Day 1: Visit Qaitbay Citadel (Alexandria). Day 2: Explore Kom El-Shoqafa Catacombs, Roman Theater. Day 3: Tour Greco-Roman Museum, Alexandria National Museum. Day 4: Visit Royal Jewelry Museum, Sunken Monuments of the Eastern Harbor.', '7', 'Historical Program');
INSERT INTO Trips (Name, Price, Days, Description, Number_of_Sites, programName) VALUES ('Oasis Odyssey', '800', '4', 'Day 1: Visit St. Catherine’s Monastery, Temple of the Oracle (Siwa). Day 2: Explore Al-Bagawat Necropolis, Hibis Temple. Day 3: Tour Deir El-Hagar Temple, Al-Ghweita Temple. Day 4: Visit Dush Temple, Bahariya Oasis Archaeological Area.', '8', 'Historical Program');
INSERT INTO Trips (Name, Price, Days, Description, Number_of_Sites, programName) VALUES ('Nile Temples', '800', '4', 'Day 1: Visit Dendera Temple, Temple of Hathor (Dendera Crypts). Day 2: Explore Edfu Temple, Kom Ombo Temple. Day 3: Tour Esna Temple, El-Tod Temple. Day 4: Visit Crocodile Museum (Kom Ombo), Gebel Silsila.', '8', 'Historical Program');
INSERT INTO Trips (Name, Price, Days, Description, Number_of_Sites, programName) VALUES ('Islamic Heritage', '800', '4', 'Day 1: Visit Sultan Hassan Mosque, Al-Rifa’i Mosque. Day 2: Explore Ahmad Ibn Tulun Mosque, Amr Ibn Al-As Mosque. Day 3: Tour Al-Zahir Baybars Mosque, Al-Ghouri Complex (Dome Sabil and House). Day 4: Visit Church of Abu Serga, Ben Ezra Synagogue.', '8', 'Historical Program');
INSERT INTO Trips (Name, Price, Days, Description, Number_of_Sites, programName) VALUES ('Theban Tombs', '900', '5', 'Day 1: Visit Valley of the Queens, Nefertari Tomb. Day 2: Explore Deir El-Medina, Rekhmire & Sennefer Tombs. Day 3: Tour Ramose Tomb, Sheikh Abd El-Qurna North Tombs. Day 4: Visit Tutankhamun’s Tomb, Ramses V & VI Tomb. Day 5: Explore Al-Asasif Necropolis.', '9', 'Historical Program');
INSERT INTO Trips (Name, Price, Days, Description, Number_of_Sites, programName) VALUES ('Ancient Cities', '900', '5', 'Day 1: Visit Mit Rahina (Memphis) Archaeological Area, Senusret I Obelisk (Matareya). Day 2: Explore Beni Hassan Tombs, Tuna El-Gebel. Day 3: Tour Tell El-Amarna, Hawara Pyramid. Day 4: Visit Lahun Pyramid, Meidum Pyramid. Day 5: Explore Karanis Archaeological Area.', '9', 'Historical Program');
INSERT INTO Trips (Name, Price, Days, Description, Number_of_Sites, programName) VALUES ('Rosetta Routes', '900', '5', 'Day 1: Visit Rashid (Rosetta) Monuments, Qaitbay Citadel (Rosetta). Day 2: Explore Abu Mena Archaeological Site, Tell Basta Museum. Day 3: Tour Nobles’ Tombs and New Kingdom Tombs (Tombs of Horemheb and Bubastites). Day 4: Visit Medinet Madi Temple, Qasr El-Miqyass (Qasr El-Ghueita). Day 5: Explore Mummification Museum, Luxor Museum.', '8', 'Historical Program');
