INSERT INTO Trips (Name, Price, Days, Description, Number_of_Sites, programName) VALUES ('Delta Expeditions', '800', '4', 'Day 1: Visit Tell Basta Archaeological Site, Vehicle Tickets for Tell Basta Archaeological Area. Day 2: Explore San El-Hagar Archaeological Site, Qarun Palace. Day 3: Tour Vehicle Tickets for Tuna El-Gebel Archaeological Area, Fraser Tombs. Day 4: Visit Mir Tombs, El-Hammamiya Tombs.', '8', 'Adventure Program');
INSERT INTO Trips (Name, Price, Days, Description, Number_of_Sites, programName) VALUES ('Luxor Ventures', '800', '4', 'Day 1: Visit Valley of the Kings, Deir El-Bahari (Hatshepsut Temple). Day 2: Explore Deir El-Medina, Valley of the Queens. Day 3: Tour Nefertari Tomb, Ramose Tomb. Day 4: Visit Ramesseum Temple, Carter House & Tutankhamun''s Replica Tomb.', '8', 'Adventure Program');
