INSERT INTO Trips (Name, Price, Days, Description, Number_of_Sites, programName) VALUES ('Upper Egypt Odyssey', '900', '5', 'Day 1: Visit Dendera Temple Panorama, Dendera Temple Crypts. Day 2: Explore Esna Temple, El-Tod Temple. Day 3: Tour Al-Ma''ala Tombs, Al-Jadawi Wekala. Day 4: Visit Mut Temple (Karnak Complex), Seti I Temple. Day 5: Explore Qurna Merai Necropolis.', '9', 'Adventure Program');
