    'The Sultan Hassan Mosque is one of the most remarkable examples of Islamic architecture in the world. Built between 1356 and 1363 during the Mamluk period, it combines both a mosque and a madrasa. It is located opposite the Citadel of Saladin and is known for its grand scale, intricate stonework, and historical importance.', 
