    'Al-Rifa’i Mosque', 
    'Cairo', 
    '08:00 AM - 05:00 PM', 
    'https://www.google.com/maps/place/Al-Rifa%27i+Mosque/@30.0296413,31.2616319,17z', 
    'Al-Rifa’i Mosque is a grand royal mosque located in Cairo, Egypt, directly adjacent to the Sultan Hassan Mosque. Built in the 19th and early 20th centuries, the mosque serves as the royal mausoleum for Egypt’s royal family and other notable figures, including the last Shah of Iran. The mosque’s architecture blends traditional Mamluk style with more modern influences.', 
    'https://lh3.googleusercontent.com/gps-cs-s/AB5caB8bhJ96e35RqxJBDR7gc0f-_688x_iH_JsHabUQoW0QvuBUM9FShLnNEgmKxs7YMbK9rvac-GYJGrG4ziv3kV8gb5aURWC8HrPKqk0w9fJYZ38n42x4FxVHh2NPbkSqj_66pK6o=w270-h156-n-k-no', 
    4.6
);
    'Al-Asasif Necropolis', 
    'Luxor', 
    '06:00 AM - 05:00 PM', 
    'https://www.google.com/maps/place/Asasif+Tombs/@25.7371728,32.6027426,17z', 
    'Al-Asasif Necropolis is an ancient burial site located on the west bank of the Nile near Luxor, Egypt. It dates back to the Late Period, the 18th Dynasty, and even earlier. The necropolis contains tombs of high-ranking officials and priests, including well-preserved tombs with beautifully painted walls and complex underground structures. It lies between the Valley of the Kings and the Valley of the Queens.', 
    'data:image/jpeg;base64,', 
    4.5
);
    'Qasr El-Miqyass (Qasr El-Ghueita)', 
    'New Valley', 
    '08:00 AM - 04:00 PM', 
    'https://www.google.com/maps/place/Temple+of+Qasr+el-Ghueita/@25.5429941,29.0130548,17z', 
    'Qasr El-Ghueita is one of the best-preserved temples in the Kharga Oasis, located in Egypt’s Western Desert. It dates back to the Persian period (around the 6th century BCE) and was dedicated to Amun, Mut, and Khonsu. The temple is built on a small hill offering a great view of the desert and palm groves surrounding it.', 
    'data:image/jpeg;base64,', 
    4.4
